import React, { Component } from 'react'

import { Segment } from 'semantic-ui-react';
import PokeIcon from './PokeIcon';

const Region = (props) => {
	// const pokeList = props.rand.map(poke => 
	// 	<img src={poke.front}></img>) 

	const pokeList = 
	<div className='region' id={props.name}>
		<img src={props.rand[0].front} className='pokeImg1'></img> 
		<img src={props.rand[1].front} className='pokeImg2'></img> 
		<img src={props.rand[2].front} className='pokeImg3'></img> 
		<img src={props.rand[3].front} className='pokeImg4'></img>
	</div>

	return(
		<div>{pokeList}</div>
	)	
}

export default Region;
